import axios from "axios";

function getNike(bearer) {
  return axios({
    method: "post",
    url: "http://localhost:8000/api/nike/getActivities",
    data: {
      bearer: bearer,
    },
  }).then((response) => {
    return response.data.activities;
  });
}

export default getNike;
